  SIGNAL count_from                       : unsigned(13 DOWNTO 0);  -- ufix14
  SIGNAL count_reset                      : unsigned(13 DOWNTO 0);  -- ufix14
  SIGNAL HDL_Counter_out1                 : unsigned(13 DOWNTO 0);  -- ufix14
  SIGNAL count                            : unsigned(13 DOWNTO 0);  -- ufix14
  SIGNAL need_to_wrap                     : std_logic;
  SIGNAL count_value                      : unsigned(13 DOWNTO 0);  -- ufix14
  SIGNAL count_1                          : unsigned(13 DOWNTO 0);  -- ufix14
  SIGNAL count_2                          : unsigned(13 DOWNTO 0);  -- ufix14
  SIGNAL prelookup_idx                    : unsigned(13 DOWNTO 0);  -- ufix14
  SIGNAL alpha1_D_Lookup_Table_out1       : unsigned(15 DOWNTO 0);  -- ufix16_En16
  SIGNAL Delay_out1                       : unsigned(15 DOWNTO 0) := to_unsigned(16#0000#, 16);  -- ufix16_En16
  SIGNAL PrevPreprocess_out1              : std_logic_vector(31 DOWNTO 0);  -- ufix32
  SIGNAL PrevPreprocess_out2_valid        : std_logic;
  SIGNAL ROI_Selector1_out1               : std_logic_vector(7 DOWNTO 0);  -- ufix8
  SIGNAL ROI_Selector1_out2_hStart        : std_logic;
  SIGNAL ROI_Selector1_out2_hEnd          : std_logic;
  SIGNAL ROI_Selector1_out2_vStart        : std_logic;
  SIGNAL ROI_Selector1_out2_vEnd          : std_logic;
  SIGNAL ROI_Selector1_out2_valid         : std_logic;
  SIGNAL CurrPreprocess_out1              : std_logic_vector(31 DOWNTO 0);  -- ufix32
  SIGNAL CurrPreprocess_out2_valid        : std_logic;

BEGIN
  -- Preprocess Subsystem selects the templates and does mean subtraction, variance normalization and windowing

  u_Edge_Detector : Edge_Detector
    PORT MAP( clk => clk,
              reset => reset,
              enb => enb,
              in0 => pixelIn,  -- uint8
              in1_hStart => ctrlIn_hStart,
              in1_hEnd => ctrlIn_hEnd,
              in1_vStart => ctrlIn_vStart,
              in1_vEnd => ctrlIn_vEnd,
              in1_valid => ctrlIn_valid,
              out0 => Edge_Detector_out1,
              out1_hStart => Edge_Detector_out2_hStart,
              out1_hEnd => Edge_Detector_out2_hEnd,
              out1_vStart => Edge_Detector_out2_vStart,
              out1_vEnd => Edge_Detector_out2_vEnd,
              out1_valid => Edge_Detector_out2_valid
              );

  u_ROI_Selector : ROI_Selector
    PORT MAP( clk => clk,
              reset => reset,
              enb => enb,
              in0 => std_logic_vector(Gain_out1),  -- uint8
              in1_hStart => Edge_Detector_out2_hStart,
              in1_hEnd => Edge_Detector_out2_hEnd,
              in1_vStart => Edge_Detector_out2_vStart,
              in1_vEnd => Edge_Detector_out2_vEnd,
              in1_valid => Edge_Detector_out2_valid,
              in2 => prevROI,  -- uint16 [4]
              out0 => ROI_Selector_out1,  -- uint8
              out1_hStart => ROI_Selector_out2_hStart,
              out1_hEnd => ROI_Selector_out2_hEnd,
              out1_vStart => ROI_Selector_out2_vStart,
              out1_vEnd => ROI_Selector_out2_vEnd,
              out1_valid => ROI_Selector_out2_valid
              );

  u_PrevPreprocess : PrevPreprocess
    PORT MAP( clk => clk,
              reset => reset,
              enb => enb,
              pixelIn => ROI_Selector_out1,  -- uint8
              pixelWindow => std_logic_vector(Delay_out1),  -- ufix16_En16
              ctrlIn_hStart => ROI_Selector_out2_hStart,
              ctrlIn_hEnd => ROI_Selector_out2_hEnd,
              ctrlIn_vStart => ROI_Selector_out2_vStart,
              ctrlIn_vEnd => ROI_Selector_out2_vEnd,
              ctrlIn_valid => ROI_Selector_out2_valid,
              frameCtrl_vEnd => Edge_Detector_out2_vEnd,
              pixelOut => PrevPreprocess_out1,  -- sfix32_En28
              ctrlOut_valid => PrevPreprocess_out2_valid
              );

  u_ROI_Selector1 : ROI_Selector1
    PORT MAP( clk => clk,
              reset => reset,
              enb => enb,
              in0 => std_logic_vector(Gain_out1),  -- uint8
              in1_hStart => Edge_Detector_out2_hStart,
              in1_hEnd => Edge_Detector_out2_hEnd,
              in1_vStart => Edge_Detector_out2_vStart,
              in1_vEnd => Edge_Detector_out2_vEnd,
              in1_valid => Edge_Detector_out2_valid,
              in2 => currROI,  -- uint16 [4]
              out0 => ROI_Selector1_out1,  -- uint8
              out1_hStart => ROI_Selector1_out2_hStart,
              out1_hEnd => ROI_Selector1_out2_hEnd,
              out1_vStart => ROI_Selector1_out2_vStart,
              out1_vEnd => ROI_Selector1_out2_vEnd,
              out1_valid => ROI_Selector1_out2_valid
              );

  u_CurrPreprocess : CurrPreprocess
    PORT MAP( clk => clk,
              reset => reset,
              enb => enb,
              pixelIn => ROI_Selector1_out1,  -- uint8
              pixelWindow => std_logic_vector(Delay_out1),  -- ufix16_En16
              ctrlIn_hStart => ROI_Selector1_out2_hStart,
              ctrlIn_hEnd => ROI_Selector1_out2_hEnd,
              ctrlIn_vStart => ROI_Selector1_out2_vStart,
              ctrlIn_vEnd => ROI_Selector1_out2_vEnd,
              ctrlIn_valid => ROI_Selector1_out2_valid,
              frameCtrl_vEnd => Edge_Detector_out2_vEnd,
              pixelOut => CurrPreprocess_out1,  -- sfix32_En28
              ctrlOut_valid => CurrPreprocess_out2_valid
              );

  
  Gain_out1 <= to_unsigned(16#FF#, 8) WHEN Edge_Detector_out1 = '1' ELSE
      to_unsigned(16#00#, 8);

  Constant_out1 <= '0';

  valid <= ROI_Selector_out2_valid;

  -- Count limited, Unsigned Counter
  --  initial value   = 0
  --  step value      = 1
  --  count to value  = 16383
  count_step <= to_unsigned(16#0001#, 14);

  count_from <= to_unsigned(16#0000#, 14);

  count_reset <= to_unsigned(16#0000#, 14);

  count <= HDL_Counter_out1 + count_step;

  
  need_to_wrap <= '1' WHEN HDL_Counter_out1 = to_unsigned(16#3FFF#, 14) ELSE
      '0';

  
  count_value <= count WHEN need_to_wrap = '0' ELSE
      count_from;

  
  count_1 <= HDL_Counter_out1 WHEN valid = '0' ELSE
      count_value;

  
  count_2 <= count_1 WHEN Constant_out1 = '0' ELSE
      count_reset;

  HDL_Counter_process : PROCESS (clk, reset)
  BEGIN
    IF reset = '1' THEN
      HDL_Counter_out1 <= to_unsigned(16#0000#, 14);
    ELSIF clk'EVENT AND clk = '1' THEN
      IF enb = '1' THEN
        HDL_Counter_out1 <= count_2;
      END IF;
    END IF;
  END PROCESS HDL_Counter_process;


  
  prelookup_idx <= to_unsigned(16#0000#, 14) WHEN HDL_Counter_out1 = to_unsigned(16#0000#, 14) ELSE
      to_unsigned(16#3FFF#, 14) WHEN HDL_Counter_out1 = to_unsigned(16#3FFF#, 14) ELSE
      HDL_Counter_out1;

  alpha1_D_Lookup_Table_out1 <= alpha1_D_Lookup_Table_data(to_integer(prelookup_idx));

  Delay_process : PROCESS (clk)
  BEGIN
    IF clk'EVENT AND clk = '1' THEN
      IF enb = '1' THEN
        Delay_out1 <= alpha1_D_Lookup_Table_out1;
      END IF;
    END IF;
  END PROCESS Delay_process;


  prevPixelOut <= PrevPreprocess_out1;

  prevCtrlOut_valid <= PrevPreprocess_out2_valid;

  currPixelOut <= CurrPreprocess_out1;

  currCtrlOut_valid <= CurrPreprocess_out2_valid;

  OutputROI <= prevROI;

END rtl;

